import 'dart:convert';
import 'dart:math';

import 'package:collection/collection.dart';
import 'package:shelf/shelf.dart';
import 'package:shelf/shelf_io.dart';
import 'package:shelf_router/shelf_router.dart';

const yogaImage =
    'data:image/jpeg;base64,';

const spinningImage =
    'data:image/jpeg;base64,';

const crossfitImage =
    'data:image/jpeg;base64,';

const yogaBlissDescription =
    'Velkommen til Yoga Bliss, en unik gruppetime designet for  transportere deg til en tilstand av dyp avslapning og harmoni. I denne timen blander vi myke yogavelser med meditative teknikker for  lse opp spenninger bde i kropp og sinn. Dette er din time-out fra hverdagens stress og mas, en sjanse til  dykke inn i en verden av ro, balanse, og total velvre.';

const spinningDescription =
    'Tr inn i rommet hvor energien er elektrisk, musikken er hy, og hvert pedaltrkk tar deg nrmere toppen av din indre Everest. Velkommen til Spin Master, en sykkeltime ulik alt du har opplevd. Dette er ikke bare en vanlig spinningklasse; dette er din billett til  bli mesteren av din egen fysiske og mentale styrke.';

const crossfitDescription =
    'Velkommen til CrossFit Challenge, en time designet for  pushe dine fysiske og mentale grenser mens du utforsker det ytterste spekteret av din styrke, utholdenhet, og smidighet. Dette er ikke bare en treningskt; det er en utfordring mot deg selv, en prvelse av viljestyrke, og en feiring av det  overkomme det som en gang virket umulig.';

final rng = Random();
final names = [
  'Yoga Bliss',
  'Spin Master',
  'CrossFit Challenge',
];
final List<String> rooms = ['Hall 1', 'Hall 2', 'Hall 3'];

const extraStuff = {
  'Yoga Bliss': (yogaImage, yogaBlissDescription, 'Zen-Zara Serenity'),
  'Spin Master': (spinningImage, spinningDescription, 'Turbo-Tor Pedalkraft'),
  'CrossFit Challenge': (
    crossfitImage,
    crossfitDescription,
    'Gritty Greta Grinder'
  ),
};

String generateToken() {
  const chars =
      'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
  final rnd = Random();
  return [for (int i = 0; i < 32; i++) chars[rnd.nextInt(chars.length)]].join();
}

List<Map<String, dynamic>> createClasses() {
  final now = DateTime.now();
  final classes = <Map<String, dynamic>>[];

  for (int i = 0; i < 7; i++) {
    for (int classNum = 0; classNum < 5; classNum++) {
      final from =
          DateTime(now.year, now.month, now.day + i, rng.nextInt(10) + 8);
      final to = from.add(const Duration(hours: 1));

      final name = names[rng.nextInt(names.length)];

      final (image, description, instructorName) = extraStuff[name]!;

      classes.add({
        "id": rng.nextInt(1000).toString(),
        "name": name,
        "description": description,
        "image": image,
        "from": from.toIso8601String(),
        "to": to.toIso8601String(),
        "spotsAvailable": rng.nextInt(5) + 5,
        "totalSpots": rng.nextInt(5) + 10,
        "instructor": instructorName,
        "room": rooms[rng.nextInt(rooms.length)],
      });
    }
  }

  return classes;
}

Response jsonResponse(dynamic json) {
  return Response.ok(jsonEncode({'data': json}));
}

Middleware basicAuthMiddleware() {
  return (Handler innerHandler) {
    return (Request request) {
      final authenticated = token != null &&
          request.headers['Authorization']?.split(' ').lastOrNull == token;

      if (authenticated || request.url.path.contains('authenticate')) {
        return innerHandler(request);
      } else {
        return Response.unauthorized(null);
      }
    };
  };
}

Response tokenHandler(Request request) {
  token = generateToken();
  return jsonResponse({'token': token});
}

Response groupClassesHandler(Request request) {
  final queryParams = request.url.queryParameters;

  try {
    final date = DateTime.parse(queryParams['date']!).copyWith(
      hour: 0,
      minute: 0,
      millisecond: 0,
    );

    final result = classes
        .where(
          (c) => DateTime.parse(c["from"])
              .copyWith(
                hour: 0,
                minute: 0,
                millisecond: 0,
              )
              .isAtSameMomentAs(date),
        )
        .toList();

    return jsonResponse(result);
  } catch (err) {
    return Response.badRequest(
      body:
          "Missing or invalid 'date' parameter. Should be in the format 'yyyy-MM-dd'.",
    );
  }
}

Response groupClassHandler(Request request) {
  final classId = request.params['id'];
  final groupClass =
      classes.firstWhereOrNull((c) => c['id'] == request.params['id']);

  if (groupClass == null) {
    return Response.notFound("No class with id '$classId'");
  }

  return jsonResponse(groupClass);
}

Response bookingsHandler(Request request) {
  final bookedClasses = bookedClassIds
      .map((id) => classes.singleWhere((c) => c['id'] == id))
      .toList();
  return jsonResponse(bookedClasses);
}

Future<Response> bookHandler(Request request) async {
  final classId = "${jsonDecode(await request.readAsString())["classId"]}";
  final groupClass = classes.firstWhereOrNull((c) => c["id"] == classId);

  if (groupClass == null) {
    return Response.notFound("Class '$classId' not found");
  }

  bookedClassIds.add(classId);

  return Response.ok('ok');
}

Future<Response> unBookHandler(Request request) async {
  final classId = jsonDecode(await request.readAsString())['classId'];
  bookedClassIds.remove('$classId');
  return Response.ok('ok');
}

String? token;
List<Map<String, dynamic>> classes = createClasses();
List<String> bookedClassIds = [];

void main() async {
  var router = Router();

  router.get('/authenticate', tokenHandler);
  router.get('/groupClasses', groupClassesHandler);
  router.get('/groupClasses/<id>', groupClassHandler);
  router.get('/bookings', bookingsHandler);
  router.post('/book', bookHandler);
  router.post('/unbook', unBookHandler);
  router.all('/<ignored|.*>', (Request request) {
    return Response.notFound(
      'The requested path was not found: ${request.url.path}',
    );
  });

  final handler =
      const Pipeline().addMiddleware(basicAuthMiddleware()).addHandler(router);

  await serve(handler, 'localhost', 8080);
}
